SELECT
    TO_CHAR(sample_time, '000000000000000')||'000' sample_hour
  , sql_id
  , sql_plan_hash_value
  , COUNT(*) * 10 seconds
  , ROUND(COUNT(*) * 10 / 3000, 2) AAS
  , COUNT(DISTINCT sql_exec_start||sql_exec_id) sampled_execs
FROM 
    dba_hist_active_sess_history
WHERE
    dbid = :0000
 AND instance_number = :0000000
AND sample_time BETWEEN TO_DATE('000000', '000000000000000000000') AND TO_DATE('000000', '000000000000000000000')
AND sql_id LIKE '000000'
GROUP BY
    TO_CHAR(sample_time, '000000000000000')||'000'
  , sql_id
  , sql_plan_hash_value
ORDER BY
    sample_hour
  , sql_id
/

